def dict_factory(cursor, row):
    d = {}
    for idx, col in enumerate(cursor.description):
        d[col[0]] = row[idx]
    return d

def typeProcess(dt):
    dt["type"] = cardType[dt["type"]]

with sqlite3.connect('cards.db') as conn:
    conn.row_factory = dict_factory
    c = conn.cursor()
    c.execute('SELECT id, type, atk, def, level, race, attribute FROM datas')
    data = c.fetchall()
    #cardData = json.dumps(data)
    for k in data:
        #--處理卡片種類--#
        k.update({"type": cardType[k["type"]]})
        if (k["type"][0][0]!="SKIP"):
            #--處理怪獸種族--#
            if k['race']!=0: k.update({"race": cardRace[k["race"]]})
            #--處理卡片屬性--#
            k.update({"attribute": cardAttr[k["attribute"] if k["type"][0][0]=="monster" else k["type"][0][0]]})
            #--處理連結怪獸----BIN 321504876--#
            ary = [3,2,1,5,0,4,8,7,6]
            b = bin(int(k['def']))[2:].zfill(9)
            for i in range(9):
                if ary[i]!=0: k.update({"link"+str(ary[i]): True if (b[i:i+1]=='1' and k["type"][0][1]=='6') else False})
            if k["type"][0][1]=='6':
                k['def']=k['level']
                k['level']=0
            #--處理攻守型別--#
            k['atk']=str(k['atk'] if k['atk']!=-2 else '?')
            k['def']=str(k['def'] if k['def']!=-2 else '?')
            #--星級和靈擺刻度----Blue To Red--#
            if(k['level']>14):
                k.update({"level": cardLevel[k["level"]][0], "blue": cardLevel[k["level"]][1], "red": cardLevel[k["level"]][2]})
            else:
                k.update({"level": k['level'], "blue": 0, "red": 0})
            #--效果文字--#
            c.execute('SELECT name, desc FROM texts where id=' + str(k['id']))
            data2 = c.fetchall()
            info = [x.replace("\r\n", r"") for x in data2[0]['desc'].split("【怪獸效果】")[::-1]]
            k.update({"title": data2[0]['name'], "infoText": info[0], "pendulumText": info[1] if len(info)==2 else ""})
            #--文字大小--#
            infoLen = len(info[0])
            pinfoLen = len(info[1]) if len(info)==2 else 0
            size = list(filter(lambda x: infoLen>=x[0], sizeList["minfo" if k["type"][0][0]=="monster" else "cinfo"]))[::-1][0][1]
            pSize = list(filter(lambda x: pinfoLen>=x[0], sizeList["pinfo"]))[::-1][0][1]
            color = "#FFFFFF" if (k["type"][0][0]!="monster" or (k["type"][0][0]=="monster" and (k["type"][0][1]=="5" or k["type"][0][1]=="6"))) else "#000000"
            k.update({"size": size, "pSize": pSize, "rare": 0, "holo": False, "color": color})

data = list(filter(lambda x: x["id"] in exist, data))
data = dict({v["id"]: v for v in data})
cardData = json.dumps(data, ensure_ascii=False)
with open('cardData.json', 'w', encoding='utf-8') as fp:
    fp.write(cardData)
